HD Suisse: Swiss View

-----------------------------------------------------

Year: 2007-2009
Country: Switzerland
Genre: Documental, Virtual Trip, Shooting from a helicopter
Duration: ~ 655 min (12 parts)

Director: Marco Fumasoli

Description: Satellite channel HD suisse invites you to a fascinating journey through Switzerland. A stunning beauty of the Swiss TV documentary, filmed specifically for the promotion of the beauties of the country to potential tourists.

-----------------------------------------------------

The contents of each part:
01 - Lachen, Benken, Amden, Churfirsten, Alt St.Johann, Wildhaus, Rheintal, Gams
02 - Buchs, Balzers
03 - Rothenthurm Moor, Agerisee, Unterageri, Zugersee, Kussnacht am Rigi, Vierwaldstattersee, Emmen, Werthenstein, Menznau, Burgdorf, Schonbuhl, Bern, Sense, Schwarzwasser
04 - Schwarzwasser, Sense
05 - Warme Sense, Schwarzsee, Schopfenspitz, Jaun, Dent de Ruth, Rochers des Rayes, Vanil Noir, Chateau d'Oex, Rougemont
06 - Le Rubli, Montbovon, Albeuve, La Sarine, Estavannens, Gruyeres, Lac de la Gruyere, Villarvolard, Corbieres
07 - Saane, Fribourg, Schiffenensee
08 - Sihlsee, Grosser Mythen, Seelisberg, Engelberger Rotstock, Wissberg, Tannensee, Triftgletscher
09 - Rhonegletscher, Belvedere am Furkapass, Hintere Gelmerhorner, Totesee, Grimselsee, Lauteraardletscher, Lauteraarhom, Finsteraarhom, Schreckhom, Fieschergletscher
10 - Murjelesee, Jungfraujoch, Monchsjochhutte, Eiger, Monch, Jungfrau, Aletschhom, Lotschenhutte, Appenzell
11 - Hundwil, Ebenalp, Schafler, Churfirsten, Schar Goggeien, Hinter Hohi, Raaberg, Speer
12 - Federspitz, Wageten, Bruckler, Chopfenberg, Wagitalersee, Sihlsee, Willerzell, Lauenensee, Lauenen, Gstaad, Schonried, Zweisimmen, Boltigen

-----------------------------------------------------

Quality: HDTV
Format: MKV
Video codec: H.264
Audio Codec: AC3
Video: 1280x720; (16/9); 50.000 fps; ~7,6-12,1 Mbps
Audio: Dolby AC3 48kHz 6ch 448 Kbps

